What a week in Türkmenistan 🇹🇲

Not sure what it is about these wild adventure trips I run - the lack of sleep, the chaos, the adventure or the illicit booze, but god does it ever attract a cool tribe. So grateful to travel to these places with these people ❤️🌍

6 days in a whirlwind. The gas crater, aka the Gates of Hell, is legit one of THE most epic adventure destinations in the planet. It never gets old. Riding old soviet trains across the country, drinking cheap local cognac, and road tripping to epic scenes. Life is stressful no doubt, but it’s also, fun, wild and beautiful. Don’t waste it folks. 

